export default App;

function App() {
  return (
    <div>
      <Header />
      <Form />
      <PackagingList />
      <Footer />
    </div>
  );
}

function Header() {
  return (
    <div>
      {" "}
      <h1>Let's Go To Travel</h1>
    </div>
  );
}

function Form() {
  return (
    <div className="add-form">
      <span>What does you need for your trip?</span>
    </div>
  );
}

function PackagingList() {
  return (
    <div className="list">
      <ul>
        <li>Paaport</li>
      </ul>
    </div>
  );
}

function Footer() {
  return (
    <footer className="stats">
      <em>
        You have packed x items on your list , and you already packed x (x %)
      </em>
    </footer>
  );
}
